package korlibs.image.format

import korlibs.encoding.*
import korlibs.image.bitmap.*
import korlibs.io.compression.*
import korlibs.io.compression.deflate.*
import korlibs.io.stream.*
import korlibs.math.geom.*
import korlibs.memory.*
import kotlin.coroutines.*

object WEBP : ImageFormat("webp") {
    private val WebpWASM = WebpWASM()

    /** Returns the WEBP ensuring it is initialized with the context. Required for Android. */
    suspend operator fun invoke(): WEBP = initOnce(coroutineContext)

    fun initOnce(context: CoroutineContext): WEBP {
        WebpWASM.initOnce(context)
        return this
    }

    override fun readImage(s: SyncStream, props: ImageDecodingProps): ImageData {
        return ImageData(WebpWASM.decodeWebpBytes(s.readAll()) ?: error("Not a WEBP"))
    }

    override fun decodeHeader(s: SyncStream, props: ImageDecodingProps): ImageInfo? {
        val size = WebpWASM.getInfo(s.readBytes(64)) ?: return null
        return ImageInfo {
            width = size.width
            height = size.height
        }
    }
}

// https://github.com/alex-michaud/wasm-tutorial-webp-decode
private class WebpWASM(bytes: ByteArray) : korlibs.wasm.WASMLib(bytes) {
    constructor() : this(WEBP_WASM_BYTES)
    fun decode(data: Int, size: Int, widthPtr: Int, heightPtr: Int): Int = invokeFuncInt("decode", data, size, widthPtr, heightPtr)
    fun get_info(data: Int, size: Int): Int = invokeFuncInt("get_info", data, size)

    fun getInfo(bytes: ByteArray): SizeInt? {
        val dataPtr = allocBytes(bytes)
        val infoPtr = get_info(dataPtr, bytes.size)
        val buffer = Buffer(readBytes(infoPtr, 12))
        freeBytes(dataPtr)
        val success = buffer.getS32(0)
        return if (success != 0) SizeInt(buffer.getS32(4), buffer.getS32(8)) else null
    }

    fun decodeWebpBytes(bytes: ByteArray): Bitmap32? {
        val memTemp = allocBytes(16)
        val dataPtr = allocBytes(bytes)
        //println("${bytes.md5()}, dataPtr=$dataPtr, bytes.size=${bytes.size}, memTemp=$memTemp")
        val decodedPtr = decode(dataPtr, bytes.size, memTemp, memTemp + 4)
        val buffer = Buffer(readBytes(memTemp, 8))
        val width = buffer.getInt32(0)
        val height = buffer.getInt32(1)

        //println("WEBP: memTemp=$memTemp, dataPtr=$dataPtr, width=$width, height=$height")

        val pixels = when {
            decodedPtr != 0 -> IntArray(width * height).also {
                Buffer(readBytes(decodedPtr, width * height * 4)).getArrayInt32(0, it)
            }
            else -> null
        }
        freeBytes(memTemp, dataPtr, decodedPtr)
        return pixels?.let { Bitmap32(width, height, it) }
    }
}

private val WEBP_WASM_BYTES = ""
    .fromBase64()
    .uncompress(ZLib)
